            for i in range(row, row + star):
                if table[i][col] == '*':
                    return []

            for i in range(col, col + star):
                if table[row][i] == '*':
                    return []

            return [[row, col]]

        def go_top(row, col, star, table):
            if not is_safe(row, col, table, star):
                return []

            result = []
            for i in range(star):
                result += find_stars(row, col + i, table)

            return result

        def go_bottom(row, col, star, table):
            if not is_safe(row, col, table, star):
                return []

            result = []
            for i in range(star):
                result += find_stars(row + star, col + i, table)

