    # 2d list of traps
    traps = [[False] * width for _ in range(height)]
    # starting position
    walls[0][0] = False
    # number of gold collected
    gold_collected = 0
    # player position
    pos = [0, 0]
    for row, line in enumerate(stdin.split('\n')):
        for col, char in enumerate(line):
            if char == '#':
                walls[row][col] = True
            elif char == 'P':
                pos = [row, col]
            elif char == 'G':
                gold[row][col] = True
                gold_collected += 1
            elif char == 'T':
                traps[row][col] = True

    # Move forward one unit in any of the four directions
    def move(pos, direction):
        pos[0] += direction[0]
        pos[1] += direction[1]
        if walls[pos[0]][pos[1]]:
            pos[0] -= direction[0]
            pos[1] -= direction[1]

    # Count how many other gold and traps are around current position
    def get_count(pos):
        count = 0
        for direction in [(0, 1), (0, -1), (-1, 0), (1, 0)]:
            new_pos = [pos[0] + direction[0], pos[1] + direction[1]]
            if new_pos == pos:
                continue
            if traps[new_pos[0]][new_pos[1]]:
                count += 1
            elif gold[new_pos[0]][new_pos[1]]:
                count += 1
        return count

    # Collect gold
    def collect_gold(pos):
        if pos == pos[0] and pos[1] == 0:
            return gold_collected
        else:
            return 0

    # Collect gold and traps
    def collect_gold_and_traps(pos):
        if pos == pos[0] and pos[1] == 0:
            return gold_collected
        else:
            return get_count(pos)

    # Move forward one unit in any of the four directions
    def move_forward(pos):
        # Trapped
        if get_count(pos)!= 0:
            return 0, False
        # Next to a trap
        elif get_count(pos) == 1:
            # Dead end
            if get_count(pos + [0, 1]) == 0:
                return 0, False
            else:
                # Collect gold
                if collect_gold(pos + [0, 1]):
                    return gold_collected, True
                else:
                    # Collect traps
                    return collect_gold_and_traps(pos + [0, 1]), True
        # Next to gold
        elif get_count(pos) == 2:
            # Collect gold
            if collect_gold(pos + [0, 1]):
                return gold_collected, True
            else:
                return 0, False
        # Move forward
        move(pos, [(0, 1)])
        return 1, True

    # Loop
    moved = True
    while moved:
        moved, _ = move_forward(pos)

    return str(gold_collected)

