                if '#' not in key and 'b' not in key:
                    # Check if the key is in the major scale.
                    if key in 'ABCDEFG':
                        possible.append(key)

    if possible:
        # Sort the notes in lexicographic order.
        possible.sort()
        # Return the major scale the song can be played in.
